    Database_manager.prototype.get_res_partner = function () {
        return this.init_database().then(function (db) {
            var sql2 = "select res_partner.active, res_partner.id, res_partner.name as name, i_t_region.name as region_id, i_t_agence.name as agence_id, i_t_zone.name as zone_id, i_t_secteur.name as secteur_id, i_t_ville.name as ville_id, res_partner.quartier, (select res_users.name from res_users where active = 1) as nom_agent_commercial_id, res_partner.nom_pos as nom_pos, res_partner.nom_gerant as nom_gerant, res_partner.adresse as adresse, res_partner.state as state_id from res_partner left join i_t_ville on res_partner.ville_id = i_t_ville.id left join i_t_region on res_partner.region_id = i_t_region.id left join i_t_agence on res_partner.agence_id = i_t_agence.id left join i_t_zone on res_partner.zone_id = i_t_zone.id left join i_t_secteur on res_partner.secteur_id = i_t_secteur.id where i_t_secteur.seller_id = (select res_users.id from res_users where active = 1) or i_t_secteur.promoter_id = (select res_users.id from res_users where active = 1) order by res_partner.active ASC";
            var data_return = [];
            return db.executeSql(sql2, [])
                .then(function (data) {
                if (data.rows.length > 0) {
                    for (var i = 0; i < data.rows.length; i++) {
                        data_return.push(data.rows.item(i));
                    }
                    return data_return;
                }
            }).catch(function (e) {
                console.log('Error on select \n' + JSON.stringify(e));
            });
        }).catch(function (e) {
            console.log('Error on connexion \n' + JSON.stringify(e));
        });
    };
